import React, { useEffect } from 'react';
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,

  MDBCollapse,
} from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom';
 import { useDispatch, useSelector } from 'react-redux';

 import { getCartTotal } from '../features/cartSlice';
export default function App() {
  const {cart, totalQuantity} = useSelector((state)=> state.allCart);

  const dispatch = useDispatch();
  useEffect(()=>{
    dispatch(getCartTotal());
  },[cart]);


  return (
    <MDBNavbar expand='lg' light bgColor='light'>
      <MDBContainer fluid>
        <MDBNavbarBrand href=''><img src='https://icons.iconarchive.com/icons/diversity-avatars/avatars/48/cristiano-ronaldo-icon.png' alt='...'/></MDBNavbarBrand>

        <MDBNavbarToggler
          aria-controls='navbarSupportedContent'
          aria-expanded='false'
          aria-label='Toggle navigation'

        >
          <MDBIcon icon='bars' fas />
        </MDBNavbarToggler>

        <MDBCollapse >
          <MDBNavbarNav className='mr-auto mb-2 mb-lg-0'>
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
              <Link to='/'>All products</Link>
              </MDBNavbarLink>
            </MDBNavbarItem>


          </MDBNavbarNav>

          <form className='d-flex input-group w-auto'>

          <Link to="/cart"><img src='https://img.icons8.com/?size=1x&id=dspqs8yd0mch&format=gif' alt='..'/>({totalQuantity})</Link>
          </form>
        </MDBCollapse>
      </MDBContainer>
    </MDBNavbar>
  );
}
